import{_ as o,c as l,j as t,a as r,G as s,a4 as i,B as c,o as p}from"./chunks/framework.DbLu_ZlF.js";const d="/shadowrocket/shadowrocket-01.png",n="/shadowrocket/shadowrocket-02.png",h="/shadowrocket/shadowrocket-03.png",m="/shadowrocket/shadowrocket-05.png",k="/shadowrocket/shadowrocket-04.png",u="/shadowrocket/shadowrocket-06.png",g="/shadowrocket/shadowrocket-07.png",w="/shadowrocket/shadowrocket-08.png",b="/shadowrocket/shadowrocket-09.png",q=JSON.parse('{"title":"小火箭安装及使用","description":"","frontmatter":{},"headers":[],"relativePath":"yiov/gfw/shadowrocket.md","filePath":"yiov/gfw/shadowrocket.md","lastUpdated":1734678955000}'),y={name:"yiov/gfw/shadowrocket.md"};function f(_,a,S,x,T,v){const e=c("ArticleMetadata");return p(),l("div",null,[a[0]||(a[0]=t("h1",{id:"小火箭安装及使用",tabindex:"-1"},[r("小火箭安装及使用 "),t("a",{class:"header-anchor",href:"#小火箭安装及使用","aria-label":'Permalink to "小火箭安装及使用"'},"​")],-1)),s(e),a[1]||(a[1]=i('<div class="tip custom-block"><p class="custom-block-title">(当前界面文档来自yiov.top)</p><ul><li><a href="https://yiov.top/" target="_blank" rel="noreferrer">yiov</a>「伊奥&#39;s 教程集」</li></ul></div><h2 id="简介" tabindex="-1">简介 <a class="header-anchor" href="#简介" aria-label="Permalink to &quot;简介&quot;">​</a></h2><p>Shadowrocket著名的网络代理工具，直译暗影火箭，俗称来源于它的LOGO：小火箭</p><p>官网（无） 丨 <a href="https://t.me/ShadowrocketApp" target="_blank" rel="noreferrer">TG群</a> 丨 <a href="https://twitter.com/shadowrocketapp" target="_blank" rel="noreferrer">推特(X)</a></p><p><img src="'+d+'" alt="" loading="lazy"></p><h2 id="协议" tabindex="-1">协议 <a class="header-anchor" href="#协议" aria-label="Permalink to &quot;协议&quot;">​</a></h2><table tabindex="0"><thead><tr><th style="text-align:center;">类型</th><th style="text-align:center;">支持协议</th></tr></thead><tbody><tr><td style="text-align:center;">节点</td><td style="text-align:center;">Shadowsocks(SS)、ShadowsocksR(SSR)、VMess(V2Ray)、VLESS(Xray)、Relay(GOST)、socks5、socks5Over TLS、HTTP、HTTPS、HTTP2、Trojan、Hysterria、Hysterria2、TUIC、Juicity、SSH、WireGuard、Snell、Brool、Lua</td></tr><tr><td style="text-align:center;">订阅</td><td style="text-align:center;">URL、clash YAML URL</td></tr></tbody></table><h2 id="客户端" tabindex="-1">客户端 <a class="header-anchor" href="#客户端" aria-label="Permalink to &quot;客户端&quot;">​</a></h2><ul><li><a href="https://apps.apple.com/us/app/shadowrocket/id932747118" target="_blank" rel="noreferrer">iOS端</a></li></ul><h2 id="安装" tabindex="-1">安装 <a class="header-anchor" href="#安装" aria-label="Permalink to &quot;安装&quot;">​</a></h2><details class="details custom-block"><summary>付费安装</summary><ul><li><p>先 <a href="./../iPhone/Apple_ID.html">注册美区Apple ID</a> 后登陆美区苹果商店</p></li><li><p>然后充值后购买 <a href="https://apps.apple.com/us/app/shadowrocket/id932747118" target="_blank" rel="noreferrer">小火箭 shadowrocket</a> 下载安装</p></li></ul></details><details class="details custom-block"><summary>免费安装</summary><ul><li><p>借别人购买过小火箭的账号，登录下载安装</p></li><li><p>或安装 <a href="./../iPhone/sign/TrollStore.html">巨魔助手</a> ，下载 <a href="https://pan.liuchengxi.com/%E5%9B%BD%E5%A4%96%E5%BA%94%E7%94%A8/Shadowrocket" target="_blank" rel="noreferrer">小火箭巨魔专用版</a> ，用巨魔安装</p></li></ul></details><p><img src="'+n+'" alt="" loading="lazy"></p><h2 id="使用" tabindex="-1">使用 <a class="header-anchor" href="#使用" aria-label="Permalink to &quot;使用&quot;">​</a></h2><p>找一个免费送流量的机场注册，点击 <code>一键订阅</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>以下截图机场仅为演示</p><p>更多免费好用机场，请查看 <a href="./channel.html">机场channel大全一览表</a></p></div><p><img src="'+h+'" alt="" loading="lazy"></p><p>选择对应的工具，我这里选 <code>shadowrocket</code>，跳转后点右上角保存</p><details class="details custom-block"><summary>没有跳转到小火箭</summary><p>点复制订阅地址，打开小火箭，右上角+号添加保存即可</p><p><img src="'+m+'" alt="" loading="lazy"></p></details><p><img src="'+k+'" alt="" loading="lazy"></p><p>设置 - 延迟测试方法，改成 <code>CONNECT</code></p><div class="tip custom-block"><p class="custom-block-title">说明</p><p>这一步虽然不是非必要的，但是是一个查看网络延迟的重要参考</p></div><p><img src="'+u+'" alt="" loading="lazy"></p><p>点击 <code>连通性测试</code> 选择延迟低的，打开开关，上 <a href="https://www.google.com/" target="_blank" rel="noreferrer">谷歌</a> 看看是否成功</p><details class="details custom-block"><summary>谷歌打不开</summary><ul><li><p>节点拉垮：换节点或机场</p></li><li><p>台湾节点：国内是屏蔽的，只能用 <a href="https://www.google.com.hk/" target="_blank" rel="noreferrer">谷歌香港</a></p></li></ul></details><p><img src="'+g+'" alt="" loading="lazy"></p><h2 id="手动添加" tabindex="-1">手动添加 <a class="header-anchor" href="#手动添加" aria-label="Permalink to &quot;手动添加&quot;">​</a></h2><p>除了机场订阅，还可以添加搭建的节点</p><p>复制了节点，打开小火箭，会弹窗</p><p><img src="'+w+'" alt="" loading="lazy"></p><details class="details custom-block"><summary>如果不弹窗怎么手搓呢</summary><p>以Vless节点为例，点 <code>+</code> 号添加</p><div class="tip custom-block"><p class="custom-block-title">说明</p><ul><li><p>类型：VLESS</p></li><li><p>地址：优选域名地址</p></li><li><p>端口：HTTP用 <code>80、8080、8880、2052、2082、2086、2095</code> 端口任选一；HTTPS用 <code>443、8843、2053、2083、2087、2096</code> 端口任选一</p></li><li><p>UUID：创建节点时的userID</p></li><li><p>TLS：根据自己搭建的情况选择开启还是关闭</p></li><li><p>传输方式</p><ul><li><p>名称：选择 <code>websocket</code></p></li><li><p>Host：输入你的搭建域名</p></li><li><p>路径：<code>/?ed=2560</code></p></li></ul></li></ul></div><p><img src="'+b+'" alt="" loading="lazy"></p></details>',31))])}const z=o(y,[["render",f]]);export{q as __pageData,z as default};
